import React from "react";
import * as S from "./styled";
export default function Button({ $icon: Icon, children, ...rest }) {
  if (Icon) {
    return (
      <S.WrapButton>
        <S.ImgIcon  src={Icon} alt="" />
        <S.Button {...rest}>{children}</S.Button>
      </S.WrapButton>
    );
  }

  return (
    <S.WrapButton>
      <S.Button {...rest}>{children}</S.Button>
    </S.WrapButton>
  );
}
